import React from 'react';
import { Route, Routes } from 'react-router-dom';

import Nav from './components/Nav.js';
import Cards from './components/Recipes.js';
import CardDetail from './components/RecipeDetail.js';
import CreateCard from './components/CreateRecipe.js';

export default function App() {
  return (
    <div> 
      <Nav/>
      <Routes>
        <Route path='/recipe/detail/:id' element={ <CardDetail/> }/>
        <Route path='/' element={ <Cards/> }/>
        <Route path='/recipe/create' element={ <CreateCard/>}/>
      </Routes>   
    </div>

  );
};
